import React from 'react'
import Intro from './project-new/Intro';
import About from './project-new/Detailpage';
import Portfolio from './project-new/Portfolio';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";

function App() {
  return (
    <div className="App">


            <Router>
                <Routes>

                    <Route
                        exact
                        path="/"
                        element={<Intro />}
                    />


                    <Route
                        path="/about"
                        element={<About />}
                    />


                    <Route
                        path="/portfolio"
                        element={<Portfolio />}
                    />

                    <Route
                        path="*"
                        element={<Navigate to="/" />}
                    />
                </Routes>
            </Router>

    </div>
  );
}

export default App;
